INSERT INTO `tb_filme` VALUES (1,'Free Guy - Assumindo o Controle','Free Guy','https://br.web.img3.acsta.net/c_310_420/pictures/21/06/10/20/47/1652456.jpg','https://www.youtube.com/watch?v=WdCy6SOPMRE','12','01:55:00','2021-08-19','Em Free Guy - Assumindo o Controle, um caixa de banco preso a uma entediante rotina tem sua vida virada de cabeça para baixo quando ele descobre que é personagem em um brutalmente realista vídeo game de mundo aberto. Agora ele precisa aceitar sua realidade e lidar com o fato de que é o único que pode salvar o mundo.'),(2,'Um Lugar Silencioso - Parte 2','A Quiet Place Part II','https://br.web.img3.acsta.net/c_310_420/pictures/21/07/07/00/23/1802515.jpg','https://www.youtube.com/watch?v=tJt2MS53cdM','14','01:37:00','2021-07-22','Em Um Lugar Silencioso - Parte 2, logo após os acontecimentos mortais do primeiro filme, a família Abbott (Emily Blunt, Millicent Simmonds e Noah Jupe) precisa agora encarar o terror mundo afora, continuando a lutar para sobreviver em silêncio. Obrigados a se aventurar pelo desconhecido, eles rapidamente percebem que as criaturas que caçam pelo som não são as únicas ameaças que os observam pelo caminho de areia.'),(3,'Os Croods 2: Uma Nova Era','The Croods: A New Age','https://br.web.img3.acsta.net/c_310_420/pictures/21/03/11/15/47/5912394.jpg','https://www.youtube.com/watch?v=sZIqMz_AC24','L','01:36:00','2021-07-01','Em Croods 2: Uma Nova Era, em busca de um habitat mais seguro, os Croods descobrem um paraíso que atende todas as suas necessidades. Entretanto, outras pessoas já moram neste lugar: Os Bettermans, uma família que se considera melhor e mais evoluída. À medida que as tensões entre os novos vizinhos começam a aumentar, uma nova ameaça impulsiona os dois clãs em uma aventura épica que os força abraçar suas diferenças, extrair forças um do outro e construir um futuro juntos.'),(4,'Velozes & Furiosos 9','F9','https://br.web.img3.acsta.net/c_310_420/pictures/21/04/14/19/06/3385237.jpg','https://www.youtube.com/watch?v=X-V1jcj2Zt8','14','02:23:00','2021-06-24','Em Velozes & Furiosos 9, Dominic Toretto (Vin Diesel) e Letty (Michelle Rodriguez) vivem uma vida pacata ao lado de seu filho Brian. Mas eles logo são ameaçados quando o irmão desaparecido de Dom retorna. Jakob (John Cena), um assassino habilidoso e excelente motorista, está trabalhando ao lado de Cipher (Charlize Theron), vilã de Velozes & Furiosos 8. Para enfrentá-los, Toretto vai precisar reunir sua equipe novamente, inclusive Han (Sung Kang), que todos acreditavam estar morto.'),(5,'O Esquadrão Suicida','The Suicide Squad','https://br.web.img2.acsta.net/c_310_420/pictures/21/06/22/22/19/1495362.jpg','https://www.youtube.com/watch?v=UkFJ90ef4_I','16','02:12:00','2021-08-05','Liderados por Sanguinário (Idris Elba), Pacificador (John Cena), Coronel Rick Flag (Joel Kinnaman), e pela psicopata favorita de todos, Arlequina (Margot Robbie), o Esquadrão Suicida está disposto a fazer qualquer coisa para escapar da prisão. Armados até os dentes e rastreados pela equipe de Amanda Waller (Viola Davis), eles são jogados (literalmente) na remota ilha Corto Maltese, repleta de militantes adversários e forças de guerrilha. O grupo de supervilões busca destruição, mas basta um movimento errado para que acabem mortos.'),(6,'Jungle Cruise','Jungle Cruise','https://br.web.img3.acsta.net/c_310_420/pictures/21/07/29/21/41/4810979.jpg','https://www.youtube.com/watch?v=LYZ3PeVIdKs','12','02:08:00','2021-07-29','Jungle Cruise gira ao redor do malandro e brincalhão Frank Wolff (Dwayne Johnson), capitão do barco La Guilla. Ele é contratado pela Dra. Lily Houghton (Emily Blunt) e seu irmão McGregor (Jack Whitehall) para levá-los em uma missão pelas densas florestas amazônicas com a intenção de encontrar uma misteriosa árvore com poderes de cura que poderá mudar para sempre o futuro da medicina. No caminho, eles viverão inúmeros perigos, enfrentando animais selvagens e até mesmo forças sobrenaturais.'),(7,'Doutor Gama','Doutor Gama','https://br.web.img2.acsta.net/c_310_420/pictures/21/07/12/19/46/5943552.jpg','https://www.youtube.com/watch?v=fpQbv2W_ECQ','14','01:20:00','2021-08-05','Doutor Gama é um filme biográfico sobre a vida do escritor, advogado, jornalista e abolicionista Luiz Gama, uma das figuras mais relevantes da história brasileira. Ele utilizou todo seu conhecimento sobre as leis e os tribunais para libertar mais de 500 escravos durante sua vida. Nascido de ventre livre, Gama foi vendido como escravo aos 10 anos para pagar dívidas de jogo de seu pai, um homem branco. Mesmo escravizado, ele conseguiu se alfabetizar, assim conquistou sua liberdade, se tornando um dos mais respeitados advogados de sua época.'),(8,'O Empregado e o Patrão','El Empleado Y El Patron','https://br.web.img2.acsta.net/c_310_420/pictures/21/07/07/16/45/4731633.jpg','https://www.youtube.com/watch?v=Zde17QMxR3k','14','01:46:00','2021-08-12','O patrão tem tudo garantido na vida, exceto uma preocupação premente: a saúde frágil de seu bebê. Paralelo a isso, o empregado busca sustento para sua filha recém-nascida e aceita uma oferta para trabalhar nas terras do patrão. Um inesperado evento trágico e uma corrida de cavalos acirrada colocam em risco o destino das duas famílias.'),(9,'Shadow','Ying','https://br.web.img3.acsta.net/c_310_420/pictures/21/07/26/21/00/2364775.jpg','https://www.youtube.com/watch?v=vWRuHO2HRZ0','14','01:56:00','2021-08-12','Durante o período dos Três Reinos na China, um Rei, muito violento e ambicioso, se prepara para a batalha final. Perdê-la significa abdicar do seu trono, suas terras e seu povo, algo que ele e o General do seu exército não estão dispostos a entregar tão facilmente. Paralelamente, as mulheres do palácio percebem que este é momento ideal para reivindicarem posições de destaque em um mundo que parece não reconhecê-las.'),(10,'O Poderoso Chefinho 2 - Negócios da Família','The Boss Baby: Family Business','https://br.web.img3.acsta.net/c_310_420/pictures/21/06/24/17/25/2242702.jpg','https://www.youtube.com/watch?v=Rm474GBjswU','L','01:47:00','2021-08-12','O Poderoso Chefinho 2 - Negócios da Família acompanha novamente os irmãos Tim e Ted, agora adultos e vivendo vidas separadas. Enquanto Tim construiu uma vida calma no subúrbio com sua esposa, Carol, e as filhas, Tabitha e Tina, Ted se transformou em um mega empresário que resolve todos os problemas com dinheiro. Mas quando Tim descobre que sua filha caçula também é agente do BabyCorp, ele precisará da ajuda do irmão mais novo para lidar com a situação.');
/*!40000 ALTER TABLE `tb_filme` ENABLE KEYS */;
